import{_ as a,c as e,o as t,aa as o}from"./chunks/framework.d_Ke7vMG.js";const v=JSON.parse('{"title":"Effective Java中文版（第3版）","description":"","frontmatter":{"title":"Effective Java中文版（第3版）","author":"Herman","updateTime":"2021-08-14 13:41","desc":"书籍","categories":"书籍","tags":"书籍/PDF","outline":"deep"},"headers":[],"relativePath":"Notes/No5Books/Effective Java中文版 第3版.md","filePath":"Notes/No5Books/Effective Java中文版 第3版.md","lastUpdated":1724593073000}'),i={name:"Notes/No5Books/Effective Java中文版 第3版.md"},r=o('<h1 id="effective-java中文版-第3版" tabindex="-1">Effective Java中文版（第3版） <a class="header-anchor" href="#effective-java中文版-第3版" aria-label="Permalink to &quot;Effective Java中文版（第3版）&quot;">​</a></h1><p><img src="https://cdn.jsdelivr.net/gh/silently9527/images/008i3skNgy1guanfbh1tcj607i09qjrd02.jpg" alt=""></p><h1 id="内容简介" tabindex="-1">内容简介 <a class="header-anchor" href="#内容简介" aria-label="Permalink to &quot;内容简介&quot;">​</a></h1><p>本书一共包含90个条目，每个条目讨论Java程序设计中的一条规则。这些规则反映了最有经验的优秀程序员在实践中常用的一些有益的做法。</p><p>全书以一种比较松散的方式将这些条目组织成11章，每一章都涉及软件设计的一个主要方面。因此，本书并不一定需要按部就班地从头读到尾，因为每个条目都有一定程度的独立性。这些条目相互之间经常交叉引用，因此可以很容易地在书中找到自己需要的内容。</p><p>本书的目标是帮助读者更加有效地使用Java编程语言及其基本类库：java.lang、java.util和java.io，以及子包，如java.util.concurrent和java.util.function。本书时不时地也会讨论其他的类库。</p><h1 id="下载地址" tabindex="-1">下载地址 <a class="header-anchor" href="#下载地址" aria-label="Permalink to &quot;下载地址&quot;">​</a></h1><p>链接: <a href="https://pan.baidu.com/s/1xQcEb5xFUSIL8lSh95enbw?pwd=xru8" target="_blank" rel="noreferrer">https://pan.baidu.com/s/1xQcEb5xFUSIL8lSh95enbw?pwd=xru8</a> 提取码: xru8</p><p>免责声明 电子书书籍全部来源于网络其他人的整理，这里只是收集整理了他们的链接，只做学习和交流使用，版权归原作者所有，如有侵权，请马上联系我，我立马删除对应链接。邮箱：380303318@qq.com</p>',9),c=[r];function s(n,l,f,_,d,p){return t(),e("div",null,c)}const u=a(i,[["render",s]]);export{v as __pageData,u as default};
